"use strict";
var Developer = /** @class */ (function () {
    function Developer(name, lang) {
        this.name = name;
        this.lang = lang;
    }
    return Developer;
}());
// dùng access modifier để khai báo thuộc tính
var Staff = /** @class */ (function () {
    function Staff(name, job) {
        this.name = name;
        this.job = job;
    }
    return Staff;
}());
